import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./style.css";
import HomeButton from 'src/Images/pizza.gif';

// const HomeButton = {
//   backgroundImage: 'url('+ HomeButton+')'
//   }


class Nav extends Component {
    render() {
      const { isAuthenticated, logout, login } = this.props.auth;

      return (
        <nav>
          <ul>
            <li>

            <Link to="/" style = {{backgroundImage: `url(${this.state.image})`}}> </Link>
            </li>

            <li>
            <Link to="/profile">Profile</Link>
            </li>

            <li>
            <Link to="/landing">Landing</Link>
            </li>

            <li>
              <button type="button" class="btn btn-primary" onClick={isAuthenticated() ? logout : login}>
                {isAuthenticated() ? "Log out" : "Log In"}
              </button>
            </li>
          </ul>
        </nav>
      );
    }
  }

  export default Nav;
